import React from "react";
import Ticker from "react-ticker";

const NewsTicker = () => (
  <Ticker>
    {({ index }) => (
      <>
        <h1>This is the Headline of element #{index}!</h1>
        <img src="www.my-image-source.com/" alt="" />
      </>
    )}
  </Ticker>
);

export default NewsTicker;
